public Document normalise() {
if (select("html").isEmpty())
if (head() == null)
if (body() == null)
normalise(head());
normalise(select("html").first());
normalise(this);
return this;
}

public static Document parseBodyFragment(String bodyHtml, String baseUri) {
Parser parser = new Parser(bodyHtml, baseUri, true);
return parser.parse();
}

public String html() {
StringBuilder accum = new StringBuilder();
html(accum);
return accum.toString().trim();
}

private Parser(String html, String baseUri, boolean isBodyFragment) {
Validate.notNull(html);
Validate.notNull(baseUri);
stack = new LinkedList<Element>();
tq = new TokenQueue(html);
this.baseUri = baseUri;
if (isBodyFragment) {
doc = Document.createShell(baseUri);
stack.add(doc.body());
doc = new Document(baseUri);
stack.add(doc);
}
